import React from 'react';
import './style.css';
import ThreeDTreePic from '../../assets/sym-tree-pic.png';

function ThreeDCreation({ setHideTree, setHideFern, setHideMandelbrot }) {
  return (
    <div className='creation' id='threeD-creation-id'>
      <div className='creation-title'>3D ThreeDCreation</div>
      <div className='fractals'>
        <div className='creation-tree' id='sym-tree'>
          <img
            src={ThreeDTreePic}
            alt='Tree pic'
            onClick={() => setHideTree(false)}
          ></img>
          <div className='fractal-title'>3D Tree</div>
        </div>
      </div>
    </div>
  );
}

export default ThreeDCreation;
